var images;
images = ['data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,'];

let element_img = document.getElementById('img');
element_img.setAttribute("src", images[0]);


document.getElementById('next').addEventListener('click', (event) => {
  let element_img2 = document.getElementById('img');
  images.push(images[0]);
  images.shift();
  let element_img3 = document.getElementById('img');
  element_img3.setAttribute("src", images[0]);

});

document.getElementById('back').addEventListener('click', (event) => {
  let element_img4 = document.getElementById('img');
  images.unshift(images.slice(-1)[0]);
  images.pop();
  let element_img5 = document.getElementById('img');
  element_img5.setAttribute("src", images[0]);

});